import { library } from "@fortawesome/fontawesome-svg-core";
import {
  faStar,
  faFilm,
  faVideo,
  faHome,
  faCalendar,
  faArrowCircleLeft
} from "@fortawesome/free-solid-svg-icons";

library.add( faStar, faFilm, faVideo, faHome, faCalendar, faArrowCircleLeft);
